            <p>© {siteInfo?.year || 2025} {siteInfo?.title || "Найденные животные"}. Все права защищены.</p>
          </div>
          <div className="col-md-6 text-md-end">
            <a href="#" className="text-white me-3">Политика конфиденциальности</a>
            <a href="#" className="text-white">Контакты</a>
          </div>
        </div>
      </div>
    </footer>
  );
}

export default Footer;
